import React, { useState } from 'react';
import './TransactionsPage.css';

export default function TransactionsPage() {
  const [q, setQ] = useState('');
  const [periodo, setPeriodo] = useState('');
  const [rows, setRows] = useState([]); // inicia vazia
  const [sortBy, setSortBy] = useState('data');
  const [sortOrder, setSortOrder] = useState('asc');

  const handleBuscar = () => {
    // Aqui integrar com backend quando rotas de transa√ß√µes existirem
    // Por enquanto, simula dados carregados
    const demo = [
      { id: 1, data: '2025-11-20', descricao: 'Compra de materiais', categoria: 'Suprimentos', tipo: 'Sa√≠da', valor: 350.00, status: 'Pendente' },
      { id: 2, data: '2025-11-21', descricao: 'Recebimento de cliente', categoria: 'Vendas', tipo: 'Entrada', valor: 1200.00, status: 'Pago' }
    ];
    setRows(demo);
  };

  const handleTodos = () => {
    handleBuscar();
  };

  const handleSort = (key) => {
    const nextOrder = sortBy === key && sortOrder === 'asc' ? 'desc' : 'asc';
    setSortBy(key);
    setSortOrder(nextOrder);
    // Em produ√ß√£o, refazer a busca com sort
  };

  return (
    <div>
      <div className="card">
        <h2>Buscar Transa√ß√µes</h2>
        <div className="filters">
          <input
            className="input"
            placeholder="Filtrar por descri√ß√£o, categoria, data, valor"
            value={q}
            onChange={(e)=>setQ(e.target.value)}
          />
          <select className="select" value={periodo} onChange={(e)=>setPeriodo(e.target.value)}>
            <option value="">Per√≠odo</option>
            <option value="hoje">Hoje</option>
            <option value="7d">7 dias</option>
            <option value="30d">30 dias</option>
          </select>
          <button className="btn btn-primary" onClick={handleBuscar}>üîé Buscar</button>
          <button className="btn btn-success" onClick={handleTodos}>üìã Todas</button>
        </div>
      </div>

      <div className="card">
        <h2>Lista de Transa√ß√µes</h2>
        <div className="table-wrap">
          <table className="table">
            <thead>
              <tr>
                {['data','descricao','categoria','tipo','valor','status'].map((col)=> (
                  <th key={col} onClick={()=>handleSort(col)}>
                    {col.charAt(0).toUpperCase() + col.slice(1)}
                    {sortBy === col && (<span className="sort">{sortOrder === 'asc' ? ' ‚ñ≤' : ' ‚ñº'}</span>)}
                  </th>
                ))}
                <th>A√ß√µes</th>
              </tr>
            </thead>
            <tbody>
              {rows.length === 0 ? (
                <tr>
                  <td className="empty" colSpan={7}>Nenhuma transa√ß√£o encontrada.</td>
                </tr>
              ) : (
                rows.map((r)=> (
                  <tr key={r.id}>
                    <td>{r.data}</td>
                    <td>{r.descricao}</td>
                    <td>{r.categoria}</td>
                    <td>{r.tipo}</td>
                    <td>{r.valor.toLocaleString('pt-BR', { style: 'currency', currency: 'BRL' })}</td>
                    <td>{r.status}</td>
                    <td>
                      <div className="actions">
                        <button className="btn btn-primary">‚úèÔ∏è Editar</button>
                        <button className="btn btn-danger">üóëÔ∏è Excluir</button>
                      </div>
                    </td>
                  </tr>
                ))
              )}
            </tbody>
          </table>
        </div>
        <div className="footer-actions">
          <button className="btn btn-primary">+ Inserir Nova Transa√ß√£o</button>
        </div>
      </div>
    </div>
  );
}
